import{_ as i,c as a,a8 as t,o as s}from"./chunks/framework.BDnHobkS.js";const c=JSON.parse('{"title":"Відлагодження з GDB","description":"","frontmatter":{},"headers":[],"relativePath":"uk/debug/gdb_debugging.md","filePath":"uk/debug/gdb_debugging.md"}'),r={name:"uk/debug/gdb_debugging.md"};function l(o,e,n,d,h,p){return s(),a("div",null,e[0]||(e[0]=[t('<h1 id="відлагодження-з-gdb" tabindex="-1">Відлагодження з GDB <a class="header-anchor" href="#відлагодження-з-gdb" aria-label="Permalink to &quot;Відлагодження з GDB&quot;">​</a></h1><p>The <a href="https://sourceware.org/gdb/documentation/" target="_blank" rel="noreferrer">GNU DeBugger (GDB)</a> comes installed with the compiler toolchain in the form of the <code>arm-none-eabi-gdb</code> binary. Налагоджувач читає символи відладки у файлі формату виконання ELF щоб зрозуміти статичну та динамічну структуру пам&#39;яті прошивки PX4. To access the PX4 autopilot microcontroller, it needs to connect to a <a href="https://sourceware.org/gdb/current/onlinedocs/gdb.html/Connecting.html" target="_blank" rel="noreferrer">Remote Target</a>, which is provided by a <a href="./swd_debug.html">SWD debug probe</a>.</p><p>Плин інформації виглядає таким чином:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">Developer</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> GDB</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> GDB</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> Server</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> Debug</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> Probe</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> SWD</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> PX4</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> Autopilot.</span></span></code></pre></div><h2 id="швидкии-старт" tabindex="-1">Швидкий старт <a class="header-anchor" href="#швидкии-старт" aria-label="Permalink to &quot;Швидкий старт&quot;">​</a></h2><p>Для початку сеансу налагодження вам зазвичай потрібно:</p><ol><li>Need a specialized <a href="./../debug/swd_debug.html#debug-probes">SWD debug probe</a>.</li><li>Find and connect to the <a href="./../debug/swd_debug.html#autopilot-debug-ports">SWD debug port</a>. You may need a <a href="./swd_debug.html#debug-adapters">debug adapter</a>.</li><li>Налаштувати та запустити зонд налагодження для створення сервера GDB.</li><li>Запустити GDB та під&#39;єднатись до сервера GDB як віддаленої цілі.</li><li>Налагоджувати прошивку інтерактивно.</li></ol><p>Дивіться документацію зонда налагодження для додаткової інформації як налаштувати з&#39;єднання для налагодження:</p><ul><li><a href="./probe_jlink.html">SEGGER J-Link</a>: commercial probe, no built-in serial console, requires adapter.</li><li><a href="./probe_bmp.html">Black Magic Probe</a>: integrated GDB server and serial console, requires adapter.</li><li><a href="./probe_stlink.html">STLink</a>: best value, integrated serial console, adapter must be soldered.</li></ul><p>Рекомендуємо використовувати J-Link з адаптером налагодження Pixhawk або STLinkv3-MINIE зі спеціально спаяним кабелем.</p><p>Після підключення ви можете використовувати звичайні команди GDB, такі як:</p><ul><li><code>continue</code> to continue program execution</li><li><code>run</code> to start from the beginning</li><li><code>backtrace</code> to see the backtrace</li><li><code>break somewhere.cpp:123</code> to set a breakpoint</li><li><code>delete somewhere.cpp:123</code> to remove it again</li><li><code>info locals</code> to print local variables</li><li><code>info registers</code> to print the registers</li></ul><p>Consult the <a href="https://sourceware.org/gdb/documentation/" target="_blank" rel="noreferrer">GDB documentation</a> for more details.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>To avoid having to type all commands to connect in GDB each time, you can write them into <code>~/.gdbinit</code>.</p></div><h2 id="наступні-кроки" tabindex="-1">Наступні кроки <a class="header-anchor" href="#наступні-кроки" aria-label="Permalink to &quot;Наступні кроки&quot;">​</a></h2><p>Ви під&#39;єднали контролер польоту до налагоджувального зонда SWD!</p><p>Наступні розділи пояснюють, як розпочати налагодження на цільовій платформі:</p><ul><li><a href="./eclipse_jlink.html">MCU Eclipse/J-Link Debugging for PX4</a>.</li><li><a href="./../dev_setup/vscode.html">Visual Studio Code IDE (VSCode)</a>.</li></ul><h2 id="вбудовані-інструменти-налагодження" tabindex="-1">Вбудовані інструменти налагодження <a class="header-anchor" href="#вбудовані-інструменти-налагодження" aria-label="Permalink to &quot;Вбудовані інструменти налагодження&quot;">​</a></h2><p>The <a href="https://pypi.org/project/emdbg/" target="_blank" rel="noreferrer">Embedded Debug Tools</a> connect several software and hardware debugging tools together in a user friendly Python package to more easily enable advanced use cases for ARM Cortex-M microcontrollers and related devices.</p><p>Ця бібліотека організовує запуск та налаштування апаратних зондів налагодження та зондів трасування, налагоджувачів, логічних аналізаторів, генераторів сигналу та надає інструменти аналізу, перетворювачі та плагіни для отримання суттєвого розуміння стану програмного та апаратного забезпечення під час або після виконання.</p><p>The <code>emdbg</code> library contains <a href="https://github.com/Auterion/embedded-debug-tools/blob/main/src/emdbg/debug/gdb.md#user-commands" target="_blank" rel="noreferrer">many useful GDB plugins</a> that make debugging PX4 easier. It also provides tools for <a href="https://github.com/Auterion/embedded-debug-tools/tree/main/ext/orbetto" target="_blank" rel="noreferrer">profiling PX4 in real-time</a>.</p>',22)]))}const k=i(r,[["render",l]]);export{c as __pageData,k as default};
